import React, { useEffect, useState } from 'react';
import { AgGridReact } from 'ag-grid-react';
import 'ag-grid-community/styles/ag-grid.css';
import 'ag-grid-community/styles/ag-theme-alpine.css';
import './ListTicket.css';

const ListTicket = () => {
  const [tickets, setTickets] = useState([]);

  const columnDefs = [
    { headerName: 'ID', field: 'id', width: 100 },
    { headerName: 'Başlık', field: 'title', flex: 1 },
    { headerName: 'Açıklama', field: 'description', flex: 2 },
    { headerName: 'Kategori', field: 'category', width: 150 },
    { headerName: 'Öncelik', field: 'priority', width: 130 },
    { headerName: 'Durum', field: 'status', width: 130 },
    { headerName: 'Oluşturan', field: 'createdBy', width: 160 },
    { headerName: 'Oluşturma Tarihi', field: 'createdAt', width: 180 },
  ];

  useEffect(() => {
    const fetchTickets = async () => {
      try {
        const response = await fetch('http://localhost:5094/api/tickets');
        const data = await response.json();
        setTickets(data);
      } catch (error) {
        console.error('Veri çekme hatası:', error);
      }
    };

    fetchTickets();
  }, []);

  return (
    <div className="ticket-container">
      <h2>Ticket Listesi</h2>
      <div className="ag-theme-alpine ticket-grid">
        <AgGridReact
          rowData={tickets}
          columnDefs={columnDefs}
          pagination={true}
          paginationPageSize={10}
          domLayout='autoHeight'
        />
      </div>
    </div>
  );
};

export default ListTicket;
